using HackerRankSolutions.GameOfThrones2;

namespace HackerRankSolutionsTest
{
    public class GameOfThrones2Test
    {
        [Theory]
        [MemberData(nameof(TestData))]
        public static void TestSome(string s, int expected)
        {
            int actual = GameOfThrones2.Solve(s);            
            Assert.Equal(expected, actual);
        }

        public static IEnumerable<object[]> TestData =>
            new List<object[]>
            {
                new object[] { "aaabbbb", 3 },
                new object[] { "cdcdcdcdeeeef", 90 },
                new object[] { "", 702352114 },
                new object[] { "", 565288459 },
            };
    }
}
